package day0311;

public class Op3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10 , b=20;
		
		System.out.println(a == b);//False
		System.out.println(a != b);//True
		System.out.println(a > b);//False
		System.out.println(a >= b);//False
		System.out.println(a < b);//True
		System.out.println(a <= b);//True

	}

}
